import React from 'react';
import './App.css';

import HucksLogo from './Components/HucksLogo';
import Greetings from './Components/Greetings';
import Footer from './Components/Footer'
import Nav from './Components/Nav'
import { CSSTransition, TransitionGroup } from 'react-transition-group';



import { BrowserRouter, Route, Switch } from 'react-router-dom';


function App() {

let location = useLocation();

  return (
    <div className="App">
     < BrowserRouter>


      <Route exact path="/" component={HucksLogo}/>
      <Route  path="/hucksapp" component={Nav}/>
      <TransitionGroup>

        <CSSTransition 
          key={location.key}
          in={console.log('in')}
          timeout={500} 
          classNames="trans_group" appear={true}
          >
            <Switch  location={location}>
              <Route exact path="/" component={Greetings}/>


          </Switch>
        </CSSTransition>
     </TransitionGroup>
    </BrowserRouter>
    <Footer/>
    </div>
  );
}

export default App;
